import React from "react";
import "./ColorCard.css";

const ColorCard = props => (
  <div 
    className="card" 
    value={props.id} 
    onClick={() => props.handleClick(props.id)}
  >
    <div className="img-container">

      <img alt={props.color} src={props.hex} />
    </div>
  </div>
);

export default ColorCard;
